package javaInterviewQuestions;

public class A3_SwapNumbers {
	 
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		 int b=20;

System.out.println("Before swapping:" + a   + " "   + b);
		
int t=b;//20
b=a;//10
a=t;//20
	
System.out.println("After swapping:" + a+ " " + b);
	}

}
